import Main from "./components/main";
import About from "./components/About";
import Project from "./components/Project";
import {BrowserRouter, Route, Routes} from 'react-router-dom';


// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyDfI7xnvv6LvJB6PmBiqaaFom50ORq73A8",
  authDomain: "jeonghoonkim-d4f87.firebaseapp.com",
  projectId: "jeonghoonkim-d4f87",
  storageBucket: "jeonghoonkim-d4f87.appspot.com",
  messagingSenderId: "189143961814",
  appId: "1:189143961814:web:a4e8dd6cf33d9b4775f977",
  measurementId: "G-Z5M3YFF3QS"
};

// Initialize Firebase
initializeApp(firebaseConfig);
// const analytics = getAnalytics(app);

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path='/' element={<Main />}/>
          <Route path='/about' element={<About />}/>
          <Route path='/project' element={<Project />}/>
        </Routes>
      </div>
    </BrowserRouter>
  )
}

export default App;
